import './App.css';
import Navbar from './components/Navbar'
import { FaGithub, FaBars } from 'react-icons/fa'
import {BrowserRouter as Router} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Navbar/>
      <FaGithub />
      <FaBars/>
    </Router>
  );
}

export default App;
